import React from 'react'
import "./Card.css"
import star from "../../assets/svg/star.svg"

function Card(props) {
    var elements = "";
    for (let index = 0; index < props.cat.rating; index++) {
        elements += "<img src={star}/>";
    }
    document.getElementById("stars").innerHTML = elements;
    return (
        <div className="animalCard">
            <img className="main-img" src={props.cat.imageURL}/>
            <h2>
                {props.cat.catName}
            </h2>
            <div className="card-start" id="rating">
                <h4>Rating: {props.cat.rating}</h4>
                <div className="star-container" id="stars"/>
            </div>
            <div className="card-price" >
                <h4>{props.cat.description}</h4>
            </div>
        </div>
    )
}

function Stars(rating) {
    var elements = "";
    for (let index = 0; index < rating; index++) {
        element += (<img src={star}/>);
    }

}

export default Card
